// src/components/HomePage.js
import React, { useState, useEffect } from 'react';
import axios from 'axios';
import logoimage from './synchrony-logo-1.png';
import './Interviews.css';

const Interviews = () => {
  const [interviewsData, setInterviewsData] = useState([]);
  const [filteredInterviews, setFilteredInterviews] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');

  useEffect(() => {
    // Fetch interviews data from the backend
    axios.get('your-backend-endpoint')
      .then((response) => {
        setInterviewsData(response.data);
        setFilteredInterviews(response.data);
      })
      .catch((error) => {
        console.error('Error fetching interviews data:', error);
      });
  }, []);

  const handleSearch = (term) => {
    setSearchTerm(term);
    const filtered = interviewsData.filter(item =>
      item.name.toLowerCase().includes(term.toLowerCase())
    );
    setFilteredInterviews(filtered);
  };

  return (
    <div className="homepage-container">
      <div className="logo-container">
        <img src={logoimage} alt="Company Logo" className="logo-image" />
      </div>

      <div className="homepage-content">
        <h1>Interviews</h1>

        {/* Search bar component */}
        <input
          type="text"
          placeholder="Search interviews..."
          value={searchTerm}
          onChange={(e) => handleSearch(e.target.value)}
        />

        {/* Display filtered interviews data */}
        <ul>
          {filteredInterviews.map((interview) => (
            <li key={interview.id}>{interview.name}</li>
            // Adjust the display based on your data structure
          ))}
        </ul>
      </div>
    </div>
  );
};

export default Interviews;
